import React from 'react';
import './App.css';
import Products from './Products'

const links = [
  { name: 'Products', to: '/products' }
]

const App: React.FC = () => {
  const navLinks = links

  return (
    <div className='App'>
      <header>
        <ul>

          <li>Home</li>
          <li>Products</li>
          <li>Services</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
